INSERT INTO ascendco.sonar_backlog (            hsys_id,            facility_id,            backlog_dts,            overall_backlog,            clean_backlog,            dirty_inst_backlog,            backlog_fiscal_week_no,            backlog_hour_bin,            backlog_day_of_week,            backlog_month_no,            overall_inst_backlog,            backlog_hour_of_day,            dirty_backlog,            backlog_year_no,            clean_inst_backlog,            backlog_date,            facility_name,            backlog_year,            date_time,            backlog_local,            backlog_fiscal_week,            date_hour,            hsys_name,            backlog_day_name,            backlog_month)      SELECT              expanded_data."HsysID",             expanded_data."FacilityID",             expanded_data."BacklogDTS",             expanded_data."OverallBacklog",             expanded_data."CleanBacklog",             expanded_data."DirtyInstBacklog",             expanded_data."Backlog_FiscalWeekNo",             expanded_data."Backlog_HourBin",             expanded_data."Backlog_DayOfWeek",             expanded_data."Backlog_MonthNo",             expanded_data."OverallInstBacklog",             expanded_data."Backlog_HourOfDay",             expanded_data."DirtyBacklog",             expanded_data."Backlog_YearNo",             expanded_data."CleanInstBacklog",             expanded_data."Backlog_Date",             expanded_data."FacilityName",             expanded_data."Backlog_Year",             expanded_data."DateTime",             expanded_data."Backlog_Local",             expanded_data."Backlog_FiscalWeek",             expanded_data."DateHour",             expanded_data."HsysName",             expanded_data."Backlog_DayName",             expanded_data."Backlog_Month"        FROM domo_passthrough  CROSS JOIN jsonb_to_recordset(domo_passthrough.data) as expanded_data (             "HsysID" uuid,             "FacilityID" uuid,             "BacklogDTS" timestamp,             "OverallBacklog" int4,             "CleanBacklog" int4,             "DirtyInstBacklog" int4,             "Backlog_FiscalWeekNo" int4,             "Backlog_HourBin" int4,             "Backlog_DayOfWeek" int4,             "Backlog_MonthNo" int4,             "OverallInstBacklog" int4,             "Backlog_HourOfDay" int4,             "DirtyBacklog" int4,             "Backlog_YearNo" int4,             "CleanInstBacklog" int4,             "Backlog_Date" date,             "FacilityName" citext,             "Backlog_Year" citext,             "DateTime" citext,             "Backlog_Local" citext,             "Backlog_FiscalWeek" citext,             "DateHour" citext,             "HsysName" citext,             "Backlog_DayName" citext,             "Backlog_Month" citext)       WHERE dataset_name = 'Sonar_BackLog_PG' AND             view_version = '3'